func lengthOfLongestSubstring(s string) int {
	if len(s) == 0 {
		return 0
	}
	i := 0
	m := map[byte]int{}
	currentLengthOfSubstrings := 0
	lengthOfSubstrings := 0
	for i < len(s) {
		char := s[i]
		if _, found := m[char]; found == true {
			if currentLengthOfSubstrings > lengthOfSubstrings {
				lengthOfSubstrings = currentLengthOfSubstrings
			}
			i = m[char] + 1
			m = map[byte]int{}
			currentLengthOfSubstrings = 0
			continue
		}
		currentLengthOfSubstrings++
		m[char] = i
		i++
	}
	if currentLengthOfSubstrings > lengthOfSubstrings {
		lengthOfSubstrings = currentLengthOfSubstrings
	}

	return lengthOfSubstrings
}
